script: |
  super -f tsv -I q6432.sql | sort > q6432.out

vector: true

inputs:
  - name: q6432.sql
    data: |
      SELECT NULLIF ( CAST ( - 86 AS INTEGER ), - CAST ( + + COUNT ( * ) AS INTEGER ) ) + + - 40 / + + CASE + 67 WHEN + 53 * - 96 + + - 15 * - - 0 THEN NULL WHEN 53 THEN - 51 WHEN COALESCE ( + 8, + MIN ( DISTINCT + + 94 ) ) THEN NULL ELSE NULL END;

outputs:
  - name: q6432.out
    data: |
      NULL
